import React, { useState } from 'react';
import { Menu } from 'antd';
import { Link } from 'react-router-dom';
import './navigation.css';


const Navigation = () => {
    const handleClick = (e) => {
        <Link to={`${e.key}`} />
    };
    return (
        <Menu
            onClick={this.handleClick}
            selectedKeys='/'
            mode="horizontal"
        >
            <Menu.Item key="/start">
                Get Started
            </Menu.Item>
            <Menu.Item key="/about">
                About
            </Menu.Item>
        </Menu>
    )
}

export default Navigation;
